import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import fetchAction from "../actions/index"
import store from "../store";

const useRegisterAPI=()=>{
    const [list,setList]=useState<any[]>([]);
    const dispatch=useDispatch();
    useEffect(()=>{
        const userFun= async ()=>{
        const responce=await fetch('https://todo-list-64f41-default-rtdb.firebaseio.com/User.json');
        const responseData = await responce.json();
        const userList=[];
        for(const key in responseData){
            userList.push({
                id:key,
                email:String(responseData[key].email),
                password:String(responseData[key].password),
                Name:String(responseData[key].Name),
                City:String(responseData[key].City),
                State:String(responseData[key].State),
                Country:String(responseData[key].Country),
                Phone:String(responseData[key].Phone),
                Imageurl:String(responseData[key].Imageurl),
            })
        }
        setList(userList);
        console.log("RegisterUserList",userList);
        dispatch(fetchAction(userList));
        console.log("getstate api",store.getState())
    };
    userFun();
    },[])
    
    return JSON.parse(JSON.stringify(list))
}
export default useRegisterAPI;
